import React, {useEffect} from "react";
import {useStore} from 'react-redux'

const ProductDetails = () => {
  const store = useStore(state => state.products)  

  useEffect(() => {
     fetch(`https://meli-345234234.firebaseio.com/catalog/${store.activeCatalog}/${store.activeCatagory}/${store.activeProduct}.json`)
     .then(res => res.json())
     .then(data => console.log(data))
  }, [])

  return <div>Product Detail!</div>;
};

export default ProductDetails;

export async function getStaticProps() {
    const res = await fetch('https://meli-345234234.firebaseio.com/catalo.json')
    const number = await res.json()
    return {
        props: {
            number: number
        }
    }
  }

  export async function getStaticPaths() {
    const res = await fetch('https://meli-345234234.firebaseio.com/test.json')
    const data = await res.json()
    console.log('paths',data)
    return {
        paths: [
            { params: { pid: '1' } },
            { params: { pid: '2' } }
          ],
      fallback: true // See the "fallback" section below
    };
  }
